sys_variable_value.value:
/*
 * Attempt to close a change request using values from the workflow scratchpad.
 */
(function () {

    var closedState = Util.getSystemPropertyInt(C.sysprop.changeRequestClosed);
    if (isNaN(closedState)) {
        workflow.warn('Unable to close the change request: system property' +
            C.sysprop.changeRequestClosed + ' does not have an integer value');
        return;
    }

    var cr = current.change_request.getRefRecord();

    // Set close notes and close state.
    if (workflow.scratchpad.close_notes) {
        cr.close_notes = workflow.scratchpad.close_notes;
    }

    if (workflow.scratchpad.close_code) {
        cr.close_code = workflow.scratchpad.close_code;
    }

    cr.state = closedState;
    cr.update();

}());

