}());

/*
 * Invokes the provisioned product workflow action and transitions depending on whether
 * the request succeeded, or whether it failed and can be retried.
 *
 * Expects the workflow to have been configured with inputs `u_action`, indicating the
 * function in ProvisionedProduct that handles the action, and `u_params`, indicating
 * the parameters for the function.
 */
(function () {

    workflow.scratchpad.invoke_attempts += 1;
    var maxRetries = workflow.scratchpad.retries_permitted,
        attempts = workflow.scratchpad.invoke_attempts;
    workflow.debug('Invocation attempt ' + attempts + "/" + maxRetries);

    var TRANSITIONS = {
        SUCCESS: 'success',
        ERROR: 'error',
        RETRY: 'retry',
    };

    var close_codes = {
        success: 'successful',
        unsuccessful: 'unsuccessful',
    };

    function succeed() {
        return {transition: TRANSITIONS.SUCCESS};
    }

    function retry(message) {
        return {transition: TRANSITIONS.RETRY, message: message};
    }

    function fail(message) {
        return {transition: TRANSITIONS.ERROR, message: message};
    }

    /**
     * Invoke the action and return a value for the activity result.
     * @param action {string} The provisioned product action to invoke.
     * @param params {object} The parameters for the action as an object structured
     * according to the corresponding AWS Service Catalog request object.
     * @return {object} a value matching an output transition condition for the workflow activity,
     * one of "success", "error" or "retry".
     */
    function invokeAction(action, params) {
        var pp = ProvisionedProduct.from(current.awsproduct.sys_id);
        if (!pp) {
            return fail('Could not identify provisioned product for event ' + current.sys_id);
        } else if (!action) {
            return fail('Required workflow parameter u_action is unset');
        }

        var handler = null;
        try {
            handler = pp.actionNamed(action.toString());
        } catch (e) {
            return fail('Unknown provisioned product action: ' + action);
        }

        workflow.info('Invoking ' + action + ' on provisioned product ' + pp.product.awsname);
        var result = handler.invoke(
            current, params, workflow.scratchpad.token, attempts < maxRetries);

        if (result.success) {
            return succeed();
        } else if (result.canRetry) {
            return retry(result.message);
        } else {
            return fail('Could not invoke ' + action + ': ' + result.message);
        }
    }

    function setSubmissionStatus(s) {
        current.awssubmissionstatus = s;
        current.update();
    }

    var r = null;
    var params = null;
    try {
        params = JSON.parse(workflow.inputs.u_params);
    } catch (err) {
        r = fail("Error parsing parameters as JSON: " + err.message);
    }

    if (params) {
        try {
            r = invokeAction(workflow.inputs.u_action, params);
        } catch (e) {
            r = fail("Caught error: " + (e.message || e.toString()));
        }
    }

    // Out of retries?
    if (r.transition === TRANSITIONS.RETRY && attempts >= maxRetries) {
        r.transition = TRANSITIONS.ERROR;
        r.message = "Could not complete " + action + "after " + attempts +
            " attempt" + (attempts !== 1 ? "s": "") + ". Last failure was: " + r.message;
    }

    activity.result = r.transition;

    switch (r.transition) {
        case TRANSITIONS.SUCCESS:
            setSubmissionStatus('SUBMITTED');
            workflow.scratchpad.close_code = close_codes.success;
            workflow.scratchpad.close_notes = "Closed automatically";
            break;
        case TRANSITIONS.ERROR:
            setSubmissionStatus('SUBMISSION_FAILED');
            workflow.warn(r.message);
            workflow.scratchpad.close_code = close_codes.unsuccessful;
            workflow.scratchpad.close_notes = r.message;
        // Fallthrough intentional.
        case TRANSITIONS.RETRY:
            activity.fault_description = r.message;
    }

})();

