// The number of times the workflow has attempted to invoke the action.
workflow.scratchpad.invoke_attempts = 0;
// The number of times to retry failed requests.
workflow.scratchpad.retries_permitted = Math.max(Util.getSystemPropertyInt(C.sysprop.retryLimit, 5), 1);
// The base delay between each retry.
workflow.scratchpad.retry_delay_seconds = Math.max(Util.getSystemPropertyInt(C.sysprop.retryDelaySeconds, 1), 1);
// Fix the token for each request.
workflow.scratchpad.token = Util.idempotencyToken('U');

