/*
 * A script for a wait condition to wait until current.change_request is approved or cancelled.
 */
var isApproved = current.change_request.approval == 'approved';
var isCancelled = false;

var cancelledState = Util.getSystemPropertyInt(C.sysprop.changeRequestCancelled);
if (!isNaN(cancelledState)) {
    isCancelled = current.change_request.state == cancelledState
} else {
    workflow.warn('System property ' + C.sysprop.changeRequestCancelled + ' does not have an integer value. ' +
        'The workflow will only proceed if the change request is approved.');
}

answer = isApproved || isCancelled;
if (answer) {
    workflow.debug("Wait on change request complete: isApproved=" + isApproved + ", isCancelled=" + isCancelled);
}

